import Header from './Header';

import styled from 'styled-components'

const GlobalStyles = styled.div`
  body {
    margin: 0;
    min-height: 100%;
    width: 100%;
  }
`
;
const Layout = props => (
  <div>
    <GlobalStyles />
    <Header />
    {props.children}
  </div>
);

export default Layout;
